import React,
       { Component }            from 'react';
import { Link }                 from 'react-router-dom';
import { getLanguage }          from './../../components/i18n';

import Particles from 'react-particles-js';

let particles_settings = {
      particles: {
        number: {
          value: 80
        },
        size: {
          value: 2
        },
        line_linked: {
          shadow: {
            enable: true,
            color: "#555",
            blur: 1
          }
        }
      }
    };

class Page404 extends Component {

  constructor( props )
  {

    super();

    let texts = getLanguage('pt-br');

    this.state = {
      texts: texts
    }

  }

  render() {

    let { texts }  = this.state;
    let page_texts = texts.page_home;

    return (
      <div>
        <Particles
          params={ particles_settings } />

          <div>
            <h1>Pagina nao encontrada</h1>

            <p>Vish, esse link nao existe</p>
            <p>Mas já que esta aqui, por que nao aproveita pra dar uma olhada no repositório do projeto?</p>

            <p><span>Front-end:</span> <Link target="_blank" to="https://github.com/felipewget/roteirizador">https://github.com/felipewget/roteirizador</Link></p>
            <p><span>Back-end:</span> <Link target="_blank" to="https://github.com/felipewget/roteirizador">https://github.com/felipewget/roteirizador</Link></p>

            <p></p>

            <Link to="/">Voltar ao Início</Link>
          </div>

      </div>
    );
  }
}

export default Page404;
